import React from 'react';
<link
  rel="stylesheet"
  href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css"
/>

class User extends React.Component {
    render() {
        const users = this.props.users;
        console.log(users);
        return (
            <table className='table'>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>name</th>
                        <th>place</th>
                    </tr>
                </thead>
                <tbody>
                    { users.map( (user) => 
                        <tr key={user.id}>
                            <td>{ user.id}</td>
                            <td>{ user.name}</td>
                            <td>{ user.place}</td>
                        </tr>
                    ) }
                </tbody>
            </table>
        )
    }
}

export default User;
